strecke={mara:42200,maraslow:42200,marafast:42200,half:21100,tenkm:10000,fivekm:5000,twofivekm:2500}
//key = "mara"
woist ={}
for (const key in runners) {
woist[key] = []

 for(i=0;i<timelimit[key];i+=60){

  
  woist[key].push([])
  temp = new Array(strecke[key]/100).fill(0)

  woist[key][i/60]=temp
  
for(p=0;p<runners[key].length;p++){
weite = Math.max(i - runners[key][p][0],0)*runners[key][p][1]
weite = Math.round(weite/100)*100
weite = Math.min(weite,strecke[key])

woist[key][i/60][weite/100]++
}

 }
